import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import LoginPage from './Components/LoginPage';
import DoctorShare from './Components/Doctor-share/doctorShare';
import TestStatus from './Components/PatientRegistration/testStatus';

function App() {
  return (
    <Router>
      <Routes>
        {/* Define Routes Correctly */}
        <Route path="/" element={<LoginPage />} />
        <Route path="/DoctorShare" element={<DoctorShare />} />
        <Route path="/TestStatus" element={<TestStatus />} />
      </Routes>
    </Router>
  );
}

export default App;
